import React, { FC } from 'react'
import { useQuery } from 'react-query'
import { productService } from '../../../services'
import { useSelector } from 'react-redux'
import { RootState } from '../../../store/store'
import { foodType } from '../../../types'
import ItemValueProduct from './ItemValueProcuct'



const ListProducts:FC = () => {

  const kfcState = useSelector((state: RootState) => state.menu.kfc)
  const pizzaDayState = useSelector((state: RootState) => state.menu.pizzaDay)
  const iqPizzaState = useSelector((state: RootState) => state.menu.iqPizza)


  const { data:pizzaDay }:foodType = useQuery('PizzaDay', () => {
    return productService.getPizzaDay()
  })

  const { data: Kfc } = useQuery('KFC', () => {
    return productService.getKFC()
  })

  const { data: iqPizza } = useQuery('IQpizza ', () => {
    return productService.getIQpizza()
  })

  return (
    <div className='bg-white'>
      <div className='mx-auto max-w-2xl px-4 py-16 sm:px-6 sm:py-24 lg:max-w-7xl lg:px-8'>
        <h2 className='text-2xl font-bold tracking-tight text-gray-900'>Menu</h2>

       <ItemValueProduct 
             storeOne={pizzaDayState}
             storeTwo={iqPizzaState}
             storeTree={kfcState}
             pizzaDay={pizzaDay}
             kfc={Kfc}
             iqPizza={iqPizza}            
             />

      </div>
    </div>
  )
}

export default ListProducts
